import React from 'react';

export const New = () => {
    return (
			<div className='new'>
				<h2>ADD A NEW SONG</h2>
				<form>
					<div>
                        <label>Title</label>
						<input type='text'></input>
					</div>
				</form>
			</div>
		);
};
